const SPAM_KEYWORDS = [
  'spam', 'wrong number', 'solicitor', 'prank',
  'hang up', 'hung up', 'no answer', 'test call',
  'robo', 'telemarket'
];

// ========== CALL STATUS MAP (DB codes, unchanged) ==========
const CALL_STATUS_MAP = {
  12: { text: 'Completed', isComplete: true },
  850: { text: 'In Queue', isComplete: false },
  14: { text: 'Agent Working', isComplete: false },
  13: { text: 'Talking', isComplete: false },
  15: { text: 'On Hold', isComplete: false },
  11: { text: 'Ringing', isComplete: false },
  509: { text: 'Voicemail', isComplete: true },
  496: { text: 'Abandoned', isComplete: true },
  1086: { text: 'Transferred', isComplete: true }
};

// ========== DEFAULT RULE (unknown codes) ==========
const DEFAULT_RULE = {
  call_type_id: null,
  law_type_broad: "Unknown",
  law_type_narrow: "Unknown",
  qualified: false,
  description: "Unknown Call Type",
  mark_as: "ARCHIVE (Not in Excel Rules)",
  job_type: null,
  price: null,
  rating: "Somewhat dissatisfied",
  reason: "It is for a service the business does not provide"
};

// ========== LOOKUP FUNCTION ==========
function lookupRule(code, notes) {
  const c = (code || '').toUpperCase().trim();
  const n = (notes || '').toLowerCase();

  // Spam overrides everything (notes-based, not in Excel)
  if (SPAM_KEYWORDS.some(kw => n.includes(kw))) {
    return {
      ...DEFAULT_RULE,
      mark_as: "ARCHIVE",
      rating: "Very dissatisfied",
      reason: "It is spam (e.g., unwanted robocall or message, silent caller, scam)",
      _source: "spam_detection"
    };
  }

  // Flat lookup
  const rule = RULES[c];
  if (rule) return { ...rule, _source: "excel_rules" };

  // Fallback
  return { ...DEFAULT_RULE, _source: "default_fallback" };
}

// ========== HELPER FUNCTIONS ==========
function getCallStatusInfo(callStatus, endTime) {
  const statusInfo = CALL_STATUS_MAP[callStatus] || { text: `Unknown (${callStatus})`, isComplete: false };
  const isComplete = endTime !== null && endTime !== undefined;
  return { code: callStatus, text: statusInfo.text, isComplete, isLiveCall: !isComplete };
}

function phoneMatches(row, searchPhone) {
  const primaryClean = String(row.PrimaryPhoneNum || '').replace(/[^0-9]/g, '');
  const calledFromClean = String(row.CalledFromNumber || '').replace(/[^0-9]/g, '');
  return primaryClean.includes(searchPhone) ||
         searchPhone.includes(primaryClean.slice(-10)) ||
         calledFromClean.includes(searchPhone) ||
         searchPhone.includes(calledFromClean.slice(-10));
}

function buildNotesField(code, rule) {
  const c = (code || '').toUpperCase().trim();
  if (!c) return rule.description || '';
  const parts = [c, '-', rule.law_type_broad || 'Unknown'];
  if (rule.description && rule.description !== rule.law_type_broad) {
    parts.push('-', rule.description);
  }
  if (rule.qualified) {
    parts.push('qual');
  } else if (rule.mark_as === 'BOOKED') {
    parts.push('nonq');
  }
  return parts.join(' ');
}

function buildCopyAllField(notesField, rating, reason) {
  let result = `Notes: ${notesField}\nRating: ${rating}`;
  if (reason) result += `\nReason: ${reason}`;
  return result;
}

