    const lastName = row.LastName || '';
    const callerName = `${firstName} ${lastName}`.trim() || 'Unknown';
    const displayPhone = row.CalledFromNumber || row.PrimaryPhoneNum;

    results.push({
      status: 'FOUND',
      input_phone: phone.original,
      name: callerName,
      phone: displayPhone,
      primary_phone: row.PrimaryPhoneNum,
      called_from: row.CalledFromNumber,
      account: row.Account || '',
      account_name: row.AccountName || '',
      media_source: row.MediaSourceName || 'N/A',
      vendor_group: row.VendorGroup || '',
      campaign_group: row.CampaignGroup || '',
      call_type: code,
      type_name: typeName,
      law_type: rule.law_type_broad || 'Unknown',
      law_type_broad_id: row.LawTypeBroadId,
      law_type_narrow_id: row.LawTypeNarrowId,
      qualified: isQualified ? 'Yes' : 'No',
      price: rule.price,
      price_display: rule.price ? `$${rule.price.toLocaleString()}` : 'N/A',
      job_type: rule.job_type || 'N/A',
      call_status_code: statusInfo.code,
      call_status_text: statusInfo.text,
      is_live_call: statusInfo.isLiveCall,
      start_time: row.StartTime,
      end_time: row.EndTime,
      rating: rule.rating,
      reason: rule.reason,
      mark_as: rule.mark_as,
      copy_notes: copyNotes,
      copy_rating: rule.rating,
      copy_reason: rule.reason,
      copy_all: copyAll,
      original_notes: notes,
      _rule_source: rule._source
    });

  } else {
    results.push({
      status: 'NOT_FOUND',
      input_phone: phone.original,
      name: '-',
      phone: phone.original,
      message: 'No lead found for this phone number'
    });
  }
}

const foundCount = results.filter(r => r.status === 'FOUND').length;
const liveCallCount = results.filter(r => r.is_live_call).length;

return {
  json: {
    results,
    total: results.length,
    found: foundCount,
    live_calls: liveCallCount
  }
};

