}
.mark-as.booked { background: #28a745; color: white; }
.mark-as.archive { background: #dc3545; color: white; }
.live-badge {
  background: #ffc107;
  color: #000;
  font-size: 11px;
  padding: 2px 6px;
  border-radius: 3px;
  margin-left: 6px;
}
.price-display {
  font-size: 18px;
  font-weight: bold;
  color: #28a745;
