}
summary:hover { background: #f0f0f0; }
.details-content { padding: 15px; background: white; }
.details-content table { width: 100%; border-collapse: collapse; }
.details-content th, .details-content td {
  padding: 8px;
  text-align: left;
  border-bottom: 1px solid #eee;
