  margin-top: 12px;
}
.copy-section h4 {
  margin: 0 0 10px 0;
  font-size: 13px;
  color: #004085;
}
.copy-textarea {
  width: 100%;
  border: 1px solid #ddd;
  border-radius: 4px;
  padding: 10px;
  font-family: monospace;
  font-size: 12px;
  resize: none;
  margin-bottom: 10px;
  line-height: 1.6;
  box-sizing: border-box;
}
.copy-all-btn {
  width: 100%;
  background: #007bff;
  color: white;
  border: none;
  padding: 10px 16px;
  border-radius: 4px;
  cursor: pointer;
  font-size: 14px;
  font-weight: 500;
}
.copy-all-btn:hover { background: #0056b3; }
.copy-all-btn.copied { background: #28a745; }
.notes-box {
  background: #f5f5f5;
  padding: 10px;
  border-radius: 4px;
  margin-top: 10px;
  white-space: pre-wrap;
  font-size: 12px;
  max-height: 80px;
  overflow-y: auto;
}
.back-btn {
  display: block;
  width: 100%;
  padding: 14px;
  margin-top: 16px;
  background: linear-gradient(135deg, #1a5f2a 0%, #2d8a3e 100%);
  color: white;
  border: none;
  border-radius: 8px;
  font-size: 16px;
  font-weight: 600;
  cursor: pointer;
  text-align: center;
  text-decoration: none;
}
.back-btn:hover { box-shadow: 0 4px 12px rgba(45, 138, 62, 0.3); }
</style>

<div class="results-wrapper">
  <div class="results-header">
    <h1>LSA Lead Lookup</h1>
    <div class="summary">Found {{ $json.found }} of {{ $json.total }} numbers</div>
  </div>

  <div class="results-body">
    {{ $json.live_calls > 0 ? '<div class="live-warning"><span class="live-warning-icon">⚠️</span><div class="live-warning-text"><strong>Live Call Detected</strong><span>One or more calls may still be in progress. Rating data may be incomplete.</span></div></div>' : '' }}

    {{ $json.results.map((r, idx) => r.status === 'FOUND' ? `
    <div class="card">
      <div class="card-header ${r.is_live_call ? 'live' : r.mark_as.toLowerCase()}">
        <div>
          <div class="phone-number">${r.phone}${r.is_live_call ? '<span class="live-badge">LIVE</span>' : ''}</div>
          <div class="name">${r.name}</div>
          <div class="media-source">${r.media_source}</div>
        </div>
        <div class="quick-info">
          <span class="mark-as ${r.mark_as.toLowerCase()}">${r.mark_as}</span>
          <div class="price-display">${r.price_display}</div>
          <div class="rating-display">${r.rating.split(' ')[0]}</div>
        </div>
      </div>
      <details>
        <summary>View Details & Copy</summary>
        <div class="details-content">
          <table>
            <tr><th>Account</th><td>${r.account} - ${r.account_name}</td></tr>
            <tr><th>Call Type</th><td>${r.call_type} - ${r.type_name}</td></tr>
            <tr><th>Law Type</th><td>${r.law_type}</td></tr>
            <tr><th>Qualified</th><td>${r.qualified}</td></tr>
            <tr><th>Job Type</th><td>${r.job_type}</td></tr>
            <tr><th>Call Status</th><td>${r.call_status_text}</td></tr>
            <tr><th>Start Time</th><td>${r.start_time}</td></tr>
            <tr><th>Rating</th><td>${r.rating}</td></tr>
            <tr><th>Reason</th><td>${r.reason || 'N/A'}</td></tr>
          </table>
          ${r.original_notes ? '<div class="notes-box">Notes: ' + r.original_notes + '</div>' : ''}
          <div class="copy-section">
            <h4>📋 Copy for LSA Platform</h4>
            <textarea id="txt${idx}" class="copy-textarea" rows="4" readonly>${r.copy_all}</textarea>
            <button class="copy-all-btn" onclick="copyText(${idx})">Copy All</button>
          </div>
        </div>
      </details>
    </div>
    ` : `
    <div class="card"><div class="card-header notfound"><div><div class="phone-number">${r.input_phone}</div><div class="name">NOT FOUND</div></div></div></div>
    `).join('') }}

    <button class="back-btn" onclick="location.reload()">Look Up More Numbers</button>
  </div>
</div>

<script>
function copyText(idx) {
  var textarea = document.getElementById('txt' + idx);
  textarea.select();
  textarea.setSelectionRange(0, 99999);
  document.execCommand('copy');
  var btn = textarea.parentNode.querySelector('.copy-all-btn');
  btn.classList.add('copied');
  btn.innerText = 'Copied!';
  setTimeout(function() {
    btn.classList.remove('copied');
    btn.innerText = 'Copy All';
  }, 2000);
}
</script>
